export default class DotsBoxes extends Component{
    n = 4;
    m = 5;
    render(){
        const line =  <div> 0 </div>

        body = () => {for(let i = 0; i < this.m; i++){
            for(let j = 0; j < this.n; j++){
                <div> {j+i} </div>
            }
        }}
        return(
            <div>
                dots boxess
                {body} 


            </div>
        )
    }
}
